import React, { Component } from 'react';

import '../App.css';

class Header extends Component {

    state = {
        favorites: true
    }
    render() {
        return (
            <header>
                <div class="head future-cop">
                    <h3 class="future">Rad</h3>
                    <h1 class="cop">RECORDS</h1>
                    <button className="toggle-favorites" onClick={this.props.toggle}>Bodacious Tunes</button>
                </div>
            </header>
        );
    }
}

export default Header;
